import React from "react";
import MenuNav from "../Components/MenuNav";

function Cart() {
    return (
        <div className="cart">
            <MenuNav />
            <div className="head">
                <h4>Корзина</h4>
                <div className="count">1</div>
            </div>
        </div>
    );
}

export default Cart;
